/**
 * finds length of a substring without repeating characters
 */
var lengthOfLongestSubstring = function(s) {
    var map = {},
        ch,
        mlength = 0,
        mainLengthTracker = 0;
    
    if (s.length === 1 || s.length === 0) {
        return s.length;
    }
    
	for (var i = 0, len = s.length; i < len; i++) {
        ch = s[i];
        if (map[ch] == undefined) {
            map[ch] = i;
            mlength += 1;
        } else {
            i = map[ch];
            map = {};
            mlength = 0;
        }

        if (mainLengthTracker < mlength) {
            mainLengthTracker = mlength;
        }
    }
    
    return mainLengthTracker;
};


